import * as React from "react";
import {
  ListItem,
  ListItemIcon,
  Box,
  Drawer,
  Toolbar,
  List,
} from "@mui/material";

export default function DrawerInHome() {
  const pathname = window.location.pathname;
  console.log("pathname :", pathname);

  return (
    <Drawer
      variant="permanent"
      anchor="left"
      sx={{
        width: drawerWidth,
        [`& .MuiDrawer-paper`]: {
          width: drawerWidth,
          boxSizing: "border-box",
        },
      }}
      style={{ zIndex: 0, height: "100%" }}
    >
      <Toolbar />
      <Box sx={{ overflow: "hidden" }} className={"manu2"}>
        <List>
          {["1", "2", "3", "4", "5"].map((text, index) => (
            <ListItem button key={text} id={"button_manu"}>
              <ListItemIcon id={"button_icons"}>
                {index === 0 ? (
                  <FaHome className="icons" />
                ) : index === 1 ? (
                  <FaLanguage className="icons" />
                ) : index === 2 ? (
                  <FaShoppingCart className="icons" />
                ) : index === 3 ? (
                  <IoChatbubblesSharp className="icons" />
                ) : index === 4 ? (
                  <IoNotifications className="icons" />
                ) : null}
              </ListItemIcon>
            </ListItem>
          ))}
        </List>
      </Box>
    </Drawer>
  );
}
